import React, { Component } from 'react';
import 'assets/css/estilos.css';

export class CadastroView extends Component {
    constructor(props){
        super(props);
        this.state = {
            nome: '',
            sobrenome: '',
            telefone: '',
            email: ''
        };

    }
    render() {
        return (
            <div>
                <header>
                    <h1 class="menu-voltar"><a href="/"><i class="far fa-arrow-left"></i>&nbsp; Voltar</a></h1>
                </header>
                <div class="wrapper-cadastro">
                    <h1 class="header-cadastro">Cadastre-se agora</h1>
                    <form onSubmit={this.cadastrar}>
                        <span>
                            <input id="nome" type="text" value={this.state.nome} onChange={(e) => this.setState({ nome: e.target.value })} ></input><br />
                            <label htmlFor="nome">Nome: </label>
                            <div class="highlight-input"></div>
                        </span>

                        <span>
                            <input id="sobrenome" type="text" value={this.state.sobrenome} onChange={(e) => this.setState({ sobrenome: e.target.value })} ></input><br />
                            <label htmlFor="sobrenome">Sobrenome: </label>
                            <div class="highlight-input"></div>
                        </span>

                        <span>
                            <input id="telefone" type="text" value={this.state.telefone} onChange={(e) => this.setState({ telefone: e.target.value })} ></input><br />
                            <label htmlFor="telefone">Telefone: </label>
                            <div class="highlight-input"></div>
                        </span>

                        <span>
                            <input id="email" type="email" value={this.state.email} onChange={(e) => this.setState({ email: e.target.value })} ></input><br />
                            <label htmlFor="email">E-Mail: </label>
                            <div class="highlight-input"></div>
                        </span>

                        <input type="submit" name="Enviar" />
                    </form>
                </div>
            </div>
        );
    }
}
